import React from 'react';
import './test.css';

class Homepage extends React.Component{

  render() {
    return <div>

        <h2>Welcome to Twitter <span> 
          <img src="https://bit.ly/37wXEkG" alt="red angry bird" width="30" height="50"/>
          </span>
        </h2>
    </div>
  }

}

export default Homepage;
